import { useState, useEffect } from "react";
import styled from "styled-components";
import Button from "../components/buttons";

const Nav_Button = styled(Button)``;

const Container = styled.div`
  position: absolute;
  top: ${({ show }) => (show ? "0%" : "-100%")};
  width: 100%;

  ${Nav_Button} {
    background-color: red;
  }
`;

function Nav(show) {
  return (
    <Container {...show}>
      <Nav_Button>Sports</Nav_Button>
      <Nav_Button>Roster</Nav_Button>
      <Nav_Button>Contact</Nav_Button>
    </Container>
  );
}

export default Nav;
